import React, { FC } from 'react'
import styles from './button.module.css'
import { Link } from 'react-router-dom'

type ClickType = {
  onClickHandler?: () => void
}

export const Button: FC<ClickType> = ({ onClickHandler }) => {
  const ClickHandler = () => {
    if (onClickHandler) {
      onClickHandler()
    }
  }

  return (
    <>
      <Link to="/popup" className={styles.buttonTweet}>
        <button type="submit" className={styles.buttonTweet} onClick={ClickHandler}>
          Tweet
        </button>
      </Link>
    </>
  )
}

export default Button
